        if self.nextPortGuid is not None:
            AIS_IngestAddNextPortGuid(builder, nextPortGuid)
        if self.nextPortLocode is not None:
            AIS_IngestAddNextPortLocode(builder, nextPortLocode)
        if self.etaCalculated is not None:
            AIS_IngestAddEtaCalculated(builder, etaCalculated)
        if self.etaUpdated is not None:
            AIS_IngestAddEtaUpdated(builder, etaUpdated)
        AIS_IngestAddDistanceToGo(builder, self.distanceToGo)
        AIS_IngestAddDistanceTravelled(builder, self.distanceTravelled)
        AIS_IngestAddAvgSpeed(builder, self.avgSpeed)
        AIS_IngestAddMaxSpeed(builder, self.maxSpeed)
        if self.createdAt is not None:
            AIS_IngestAddCreatedAt(builder, createdAt)
        if self.createdBy is not None:
            AIS_IngestAddCreatedBy(builder, createdBy)
        if self.source is not None:
            AIS_IngestAddSource(builder, source)
        if self.sourceDl is not None:
            AIS_IngestAddSourceDl(builder, sourceDl)
        if self.origin is not None:
            AIS_IngestAddOrigin(builder, origin)
        AIS_IngestAddDataMode(builder, self.dataMode)
        if self.origNetwork is not None:
            AIS_IngestAddOrigNetwork(builder, origNetwork)
        aisIngest = AIS_IngestEnd(builder)
        return aisIngest
